import React from 'react';
import {Link} from 'react-router-dom';

const NavBar = () => {
    <ul>
      <li><Link to="/">Home</Link></li>
      <li><Link to="/pastentries">Past Entries</Link></li>
      <li><Link to="/about">About Daily Journal</Link></li>
    </ul>
}

export default NavBar;
